actionConfiguration.body:
() => {
  NoteMese.run();
  NoteMesePrec.run();
  let divisione = NoteMese.data[0].count / NoteMesePrec.data[0].count - 1;
  let perc = divisione * 100;
  let notes = NoteMese.data[0].count - NoteMesePrec.data[0].count;
  if (notes > 0) {
    var str = notes + ' in pi첫 rispetto al mese attuale';
  } else {
    str = notes + ' in meno rispetto al mese attuale';
  }
  if (perc > 100) {
    var percentage = perc + '% in pi첫 rispetto al mese precedente';
  } else {
    percentage = perc + '% in meno rispetto al mese precedente';
  }
  storeValue('percentage', percentage, false);
  storeValue('notes', str, false);
  return [divisione, perc];
}

